import { Button, Card, Typography } from "@mui/material";
import { Box } from "@mui/system";
// import axios from "axios";
import { Link } from "react-router-dom";

export const CartProduct = () => {
   
  return (
    <>
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        height="100vh"
        sx={{ backgroundColor: "grey" }}
      >
        <Card
          variant="outlined"
          sx={{
            maxWidth: "200px",
            height: "250px",
            p: 2,
            overflow: "visible",
            background: "#d0d0d0",
          }}
        >
          <Box
            sx={{
              display: "flex",
              flexDirection: "column",
              gap: 2,
              p: 2,
              color: "blue",
              px: 1,
              
            }}
          >
            <Typography
              sx={{
                fontWeight: "700",
                textAlign: "Left",
                fontFamily: "arial",
                fontSize: "10px",
                marginBottom: "30px",
              }}
            >
              Your Shopping Cart
            </Typography>
          </Box>

          <Button
            sx={{
              mt: "20px",
              px: 1,
              width: "100%",
              color: "red",
              p: 1,
              background: "Green",
              fontWeight: "bold",
             
            }}
          >
            <Link to="/CartProduct"> Checkout</Link>
          </Button>

          <Button
            sx={{
              mt: "20px",
              px: 1,
              width: "100%",
              color: "red",
              p: 1,
              background: "Green",
              fontWeight: "bold",
             
            }}
          >
            <Link to="/CartProduct"> Close </Link>
          </Button>
          
        </Card>
      </Box>
    </>
  );
};
